import React from "react";
import PropTypes from "prop-types";

export default function Navbar(props) {
  const hmm = function  getcolor()
    {
      if(props.color==="dark ")
      {
        return "white"
      }
      }
  return (
    <nav style={{backgroundColor : hmm}}
      className={`navbar navbar-expand-lg navbar-${props.mode} `} 
    >
      <div className="container-fluid">
        <a className="navbar-brand" href="/">
          {props.title}
        </a>
        <button
          className="navbar-toggler"
          type="button"
          data-bs-toggle="collapse"
          data-bs-target="#navbarSupportedContent"
          aria-controls="navbarSupportedContent"
          aria-expanded="false"
          aria-label="Toggle navigation"
        >
          <span className="navbar-toggler-icon"></span>
        </button>
        <div className="collapse navbar-collapse" id="navbarSupportedContent">
          <ul className="navbar-nav me-auto mb-2 mb-lg-0">
            <li className="nav-item">
              <a className="nav-link active" aria-current="page" href="/">
                Home
              </a>
            </li>
            <li className="nav-item">
              <a className="nav-link" href="/">
                {props.about}
              </a>
            </li>
          </ul>
          <div className="btn-group" role="group" aria-label="Basic example">
            <button type="button" onClick={props.clickLight} className="btn btn-primary">
              Default
            </button>
            <button type="button" onClick={props.clickDark} className="btn btn-primary">
              Dark 
            </button>
            <button type="button" onClick={props.clickBlue} className="btn btn-primary">
              Blue
            </button>
            <button type="button" onClick={props.clickGreen} className="btn btn-primary">
              Green
            </button>
            <button type="button" onClick={props.clickPink} className="btn btn-primary">
              Pink
            </button>
          </div>
          <form className="d-flex" role="search">
            <input
              className={`form-control me-2`}
              type="search"
              placeholder="Search"
              aria-label="Search"
              style={{
                backgroundColor: props.mode === "dark" ? "#252525" : "white",
                color: props.mode === "dark" ? "white" : "Black",
              }}
            />

            <button className="btn btn-outline-success" type="submit">
              Search
            </button>
          </form>
        </div>
      </div>
    </nav>
  );
}

Navbar.propTypes = {
  title: PropTypes.string.isRequired,
  about: PropTypes.string.isRequired,
};

Navbar.defaultProps = {
  title: "set title here",
  about: "set about here",
};
